import React from "react";
import {
  Table,
  TableHead,
  TabelRow,
  TabelCell,
  TableBody,
  Checkbox,
} from "@material-ui/core";

export default function TableTask() {
  return (
    <Table>
      <TableBody>
        <TableRow>
          <TableCell>
            <Checkbox color="secondary" />
          </TableCell>
        </TableRow>
      </TableBody>
    </Table>
  );
}
